import React, { useState } from 'react';
import '../style/Ham.scss';

const Ham = () => {
  const [isOpen, setIsOpen] = useState(false);

  const toggleMenu = () => {
    setIsOpen(!isOpen);
  };

  return (
    <div>
      <div className="hamburger-menu" onClick={toggleMenu}>
        <div></div>
        <div></div>
        <div></div>
      </div>

      <div className={`menu ${isOpen ? 'open' : ''}`}>
        <div className="menu-item">로그인</div>
        <div className="menu-item">랭킹</div>
        <div className="menu-item">럭셔리</div>
        <div className="menu-item">남성</div>
        <div className="menu-item">여성</div>
      </div>
    </div>
  );
};

export default Ham;
